import React from "react";
import Card from "./Card";
import contacts from "../contacts"

function App() {
  return (
   <div>
     <Card 
        name = {contacts[0].name}
        img = {contacts[0].imgURL}
     />
     <Card />
     <Card />
   </div>
  );
}

export default App;
